    setDel(title)
    //set(title)
    //console.log(title)
  }

  const completedArr = () => {
    setCom(title)
    //console.log(title)
  }

  return (
    <div className="todo">
      <p className="title">{title}</p>
      <button className="com" onClick={completedArr}>completed</button>
      <button className="del" onClick={deletedArr}>deleted</button>
    </div>
  )
}

